function obligatorio(name, enable) {
    if (enable) {
        var required = {
            required: true,
            messages: {
                required: "El campo es obligatorio"
            }
        };
        $("[name='" + name + "']").rules("add", required);
        $("[name='" + name + "']").addClass('required');
    } else {
        $("[name='" + name + "']").rules("remove", "required");
        $("[name='" + name + "']").removeClass('required');
        $("[name='" + name + "']").removeClass('is-invalid');
    }
}

function get_date_object(fecha) {
    var partes_fecha = fecha.split("/");
    if (partes_fecha.length == 3) {
        return new Date(partes_fecha[2], partes_fecha[1] - 1, partes_fecha[0]);
    }
    return null;
}

function get_string_from_date(date) {
    if (date) {
        return date.getDate() + "/" + (date.getMonth() + 1) + "/" + date.getFullYear();
    }
    return "";
}


function isEmptyObject(obj) {
    for (var key in obj) {
        if (obj.hasOwnProperty(key)) {
            return false;
        }
    }
    return true;
}

